import style from './nav.module.css';
import { NavLink } from "react-router-dom";
export default function Nav(props) {
   return (
      <div className={style.nav}>
         <Searchbar onSearch={props.onSearch}/>
         <button >
            <NavLink to="/about"></NavLink>
         </button>
         <button path="/">
            Home
         </button>
      </div>
   );
}
